import React from "react";
import { Link } from "react-router-dom";
import "../App.css";
import { Button, Menu } from "semantic-ui-react";

const Nav = props => (
  <Menu fluid widths={4} fixed="top" inverted color="teal" tertiary>
    <Menu.Item as={Link} to="/" name="home">
      NEW NEW PROJECT
    </Menu.Item>
    <Menu.Item as={Link} to="/project" name="projects">
      Projects
    </Menu.Item>
    {/* <Menu.Item as={Link} to="/LogInForm" name="logIn">
      LogIn
    </Menu.Item>
    <Menu.Item as={Link} to="/signup" name="signup">
      SignUp
    </Menu.Item> */}
    <Button primary onClick={() => props.handleFormSwitch("signUp")}>
      signup
    </Button>
    <Button secondary onClick={() => props.handleFormSwitch("login")}>
      login
    </Button>
    )
  </Menu>
);

export default Nav;
